import {
  loadChofers,
  createChofers,
  updateChoferes,
  deleteChoferes,
  clearchoferes,
} from "../../actions/choferesActions";

import service from "../../helpers/services";

const getChoferes = () => {
  return () => {
    service.get("/choferes/").then((res) => {
      console.log("ver res", res);
      loadChofers(res);
    });
  };
};

export default { getChoferes };
